import React from 'react';
import '../../App.css';

export default function SignUp() {
  return 
  <div>
  <h1 className='sign-up'><a target="_blank"href="https://open.spotify.com/artist/1U9oQ2kPIAOymZLvRK4wrs">LISTEN:</a></h1>
  <iframe src="https://open.spotify.com/embed/artist/1U9oQ2kPIAOymZLvRK4wrs" width="300" height="380" frameborder="0" allowtransparency="true" allow="encrypted-media"></iframe>
  </div>

  
  ;
}
